#define TOKENV(name, ...) do { return sinker::Parser::make_##name(__VA_ARGS__, loc); } while(0)
#define VERIFY(cond, loc, ...) do { if (!(cond)) { sinker::Parser::error(loc, format_verify_message(__VA_ARGS__)); YYERROR; } } while(0)



